import sys

def main():
    a, b = map(int, sys.stdin.readline().split())
    for i in range(1, 100000):
        if int(i * 0.08) == a and int(i * 0.1) == b:
            print(i) 
            return 
    print(-1) 

if __name__ == '__main__':
    main()
